export const returnRewards = (customerTransactions) => {
    return [{ name: 'mike', totalPoints: 100, october: 20, november: 30, decemebr: 40},
    { name: 'Joke', totalPoints: 100, october: 20, november: 30, decemebr: 40},
    { name: 'Steak', totalPoints: 100, october: 20, november: 30, decemebr: 40}]
}
